import React from 'react';

class App extends Conf2022 {
    render() {
      const myStyle={
          backgroundImage: 
   "url('https://drive.google.com/file/d/1HdX_E08eiURwE7H4i8nsjUBZqd7a4Bbr/view?usp=share_link')",
          height:'100vh',
          marginTop:'-70px',
          fontSize:'50px',
          backgroundSize: 'cover',
          backgroundRepeat: 'no-repeat',
      };
      return (
        <div style={myStyle}>
          <h1> geeksforgeeks </h1>
        </div>
      );
    }
  }
     
  export default App;
